[
  {
    "message_name": "UBX-CFG-VALDEL",
    "message_id": "0x06 0x8c",
    "sub_message_name": "Delete configuration item values",
    "description": "This message can be used to delete saved configuration to effectively revert the item values to defaults. This message can delete saved configuration from the flash configuration layer and the BBR configuration layer. The changes will not be effective until these layers are loaded into the RAM layer. This message is limited to containing a maximum of 64 keys up for deletion; i.e. N is a maximum of 64. This message can be used multiple times and every time the result will be applied immediately. To send this message multiple times with the result being applied at the end, see version 1 of UBX-CFG-VALDEL that supports transactions. This message does not check if the resulting configuration is valid. See Receiver configuration for details. This message returns a UBX-ACK-NAK and no configuration is applied: if any key is unknown to the receiver FW if the layer's bitfield does not specify a layer to delete a value from. Notes: If a key is sent multiple times within the same message, the value is effectively deleted only once. Attempting to delete items that have not been set before, or that have already been deleted, is considered a valid request. The provided keys can be complete key values (group and item specifiers) or wild-card specifications. A complete key value constitutes a deletion request for one key-value pair. A key value with a valid group specifier and 0xffff in the item part of the key value (bits 0-15) constitutes a deletion request for all items in the specified group. A key with a value of 0xfff in the group part of the key value (bits 16-27) is a deletion request for all items known to the receiver in all groups.",
    "payload": [
      {
        "offset": "0",
        "type": "U1",
        "name": "version",
        "description": "Message version (0x00 for this version)"
      },
      {
        "offset": "1",
        "type": "X1",
        "name": "layers",
        "description": "The layers where the configuration should be deleted from",
        "bit_fields": [
          {
            "bit_offset": "bit 1",
            "bit_length": "U:1",
            "name": "bbr",
            "description": "Delete configuration from the BBR layer"
          },
          {
            "bit_offset": "bit 2",
            "bit_length": "U:1",
            "name": "flash",
            "description": "Delete configuration from the Flash layer"
          }
        ]
      },
      {
        "offset": "2",
        "type": "U1[2]",
        "name": "reserved0",
        "description": "Reserved"
      },
      {
        "offset": "4+",
        "type": "U4",
        "name": "keys",
        "description": "Configuration key IDs of the configuration items to be deleted"
      }
    ]
  },
  {
    "message_name": "UBX-CFG-VALDEL",
    "message_id": "0x06 0x8c",
    "sub_message_name": "Delete configuration item values (with transaction)",
    "description": "This message can be used to delete saved configuration to effectively revert them to defaults. This message can delete saved configuration from the flash configuration layer and the BBR configuration layer. The changes will not be effective until these layers are loaded into the RAM layer. This message is limited to containing a maximum of 64 keys up for deletion; i.e. N is a maximum of 64. This message can be used multiple times with the result being managed within a transaction. This message does not check if the resulting configuration is valid. See Receiver configuration for details. See version 0 of UBX-CFG-VALDEL for simplified version of this message. This message returns a UBX-ACK-NAK, cancels any started transaction, and no configuration is applied: if any key within a transaction is unknown to the receiver FW if an invalid transaction state transition is requested if the layer's bitfield changes within a transaction if the layer's bitfield does not specify a layer to delete a value from. Notes: Any request for another UBX-CFG- message type (including UBX-CFG-VALSET and UBX-CFG-VALGET) will cancel any started transaction, and no configuration is applied. This message can be sent with no keys to delete for the purposes of managing the transaction state transition. If a key is sent multiple times within the same message or within the same transaction, the value is effectively deleted only once. Attempting to delete items that have not been set before, or that have already been deleted, is considered a valid request. The provided keys can be complete key values (group and item specifiers) or wild-card specifications. A complete key value constitutes a deletion request for one key-value pair. A key value with a valid group specifier and 0xffff in the item part of the key value (bits 0-15) constitutes a deletion request for all items in the specified group. A key with a value of 0xfff in the group part of the key value (bits 16-27) is a deletion request for all items known to the receiver in all groups.",
    "payload": [
      {
        "offset": "0",
        "type": "U1",
        "name": "version",
        "description": "Message version (0x01 for this version)"
      },
      {
        "offset": "1",
        "type": "X1",
        "name": "layers",
        "description": "The layers where the configuration should be deleted from",
        "bit_fields": [
          {
            "bit_offset": "bit 1",
            "bit_length": "U:1",
            "name": "bbr",
            "description": "Delete configuration from the BBR layer"
          },
          {
            "bit_offset": "bit 2",
            "bit_length": "U:1",
            "name": "flash",
            "description": "Delete configuration from the Flash layer"
          }
        ]
      },
      {
        "offset": "2",
        "type": "X1",
        "name": "transaction",
        "description": "Transaction action to be applied:",
        "bit_fields": [
          {
            "bit_offset": "bits 1...0",
            "bit_length": "U:2",
            "name": "action",
            "description": "Transaction action to be applied: 0 = Transactionless UBX-CFG-VALDEL: In the next UBX-CFG-VALDEL, it can be either 0 or 1. If a transaction has not yet been started, the incoming configuration is applied. If a transaction has already been started, cancels any started transaction and the incoming configuration is applied. 1 = (Re)Start deletion transaction: In the next UBX-CFG-VALDEL, it can be either 0, 1, 2 or 3. If a transaction has not yet been started, a transaction will be started. If a transaction has already been started, restarts the transaction, effectively removing all previous non-applied UBX-CFG-VALDEL messages. 2 = Deletion transaction ongoing: In the next UBX-CFG-VALDEL, it can be either 0, 1, 2 or 3. 3 = Apply and end a deletion transaction: In the next UBX-CFG-VALDEL, it can be either 0 or 1."
          }
        ]
      },
      {
        "offset": "3",
        "type": "U1",
        "name": "reserved0",
        "description": "Reserved"
      },
      {
        "offset": "4+",
        "type": "U4",
        "name": "keys",
        "description": "Configuration key IDs of the configuration items to be deleted"
      }
    ]
  }
]
